<!DOCTYPE html>
<html lang="pt-BR">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>SITES DA MÓVEL</title>
    <style>
        body {
            font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
            background-color: #121212;
            color: #fff;
            margin: 0;
            padding: 0;
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            overflow: hidden;
        }

        .container {
            background: linear-gradient(135deg, #222, #444);
            border-radius: 12px;
            box-shadow: 0 10px 20px rgba(0, 0, 0, 0.7);
            padding: 40px;
            text-align: center;
            width: 400px;
            max-width: 90%;
            transition: all 0.3s ease;
        }

        h1 {
            color: #f39c12;
            font-size: 32px;
            margin-bottom: 30px;
            letter-spacing: 2px;
            font-weight: bold;
        }

        #searchBar {
            width: 100%;
            padding: 14px;
            border: 2px solid #444;
            border-radius: 8px;
            font-size: 18px;
            background-color: #222;
            color: #fff;
            transition: all 0.3s ease;
        }

        #searchBar:focus {
            border-color: #f39c12;
            outline: none;
        }

        #suggestions {
            display: none;
            background-color: #333;
            border-radius: 8px;
            box-shadow: 0 0 5px rgba(243, 156, 18, 0.3);
            overflow-y: auto;
            max-height: 200px;
            margin-top: 10px;
            padding: 5px;
        }

        #suggestions p {
            padding: 12px;
            margin: 0;
            cursor: pointer;
            transition: background-color 0.3s ease;
            border-radius: 6px;
        }

        #suggestions p:hover {
            background-color: #555;
        }

        #searchResults {
            margin-top: 20px;
            font-size: 18px;
        }

        .button {
            background: none;
            border: none;
            color: #fff;
            cursor: pointer;
            font-size: 20px;
            padding: 10px;
            transition: background-color 0.3s;
            border-radius: 8px;
            margin-top: 10px;
        }

        .button:hover {
            background-color: #444;
        }

        .copy-btn, .map-btn {
            padding: 12px 16px;
            font-size: 18px;
            border-radius: 8px;
            cursor: pointer;
            margin-top: 10px;
            transition: background-color 0.3s ease;
            display: inline-block;
        }

        .copy-btn {
            background-color: #f39c12;
        }

        .copy-btn:hover {
            background-color: #e67e22;
        }

        .map-btn {
            background-color: #3498db;
        }

        .map-btn:hover {
            background-color: #2980b9;
        }

        /* Novo estilo para o feedback de cópia */
        #copyFeedback {
            position: fixed;
            top: 20px;
            left: 50%;
            transform: translateX(-50%);
            background-color: #28a745;
            color: #fff;
            padding: 10px 20px;
            border-radius: 8px;
            opacity: 0;
            visibility: hidden;
            transition: opacity 0.4s ease, visibility 0.4s ease;
            font-size: 18px;
        }

        #copyFeedback.show {
            opacity: 1;
            visibility: visible;
        }
    </style>
</head>

<div class="container">
    <h1>BUSCADOR DE CF ES</h1>

</div>

    function normalizarTexto(texto) {
        return texto.toLowerCase()
            .normalize("NFD")
            .replace(/\p{Diacritic}/gu, "");
    }

    function calcularDistancia(a, b) {
        let dp = Array(a.length + 1).fill(null).map(() => Array(b.length + 1).fill(0));
        for (let i = 0; i <= a.length; i++) dp[i][0] = i;
        for (let j = 0; j <= b.length; j++) dp[0][j] = j;
        for (let i = 1; i <= a.length; i++) {
            for (let j = 1; j <= b.length; j++) {
                let custo = a[i - 1] === b[j - 1] ? 0 : 1;
                dp[i][j] = Math.min(dp[i - 1][j] + 1, dp[i][j - 1] + 1, dp[i - 1][j - 1] + custo);
            }
        }
        return dp[a.length][b.length];
    }

    function buscarSugestoes(termo) {
        termo = normalizarTexto(termo);
        return dados.filter(([chave]) => {
            const chaveNormalizada = normalizarTexto(chave);
            return chaveNormalizada.startsWith(termo) || calcularDistancia(termo, chaveNormalizada) <= 2;
        });
    }

    function search(termo) {
        const resultado = dados.find(([chave]) => normalizarTexto(chave) === normalizarTexto(termo));
        if (resultado) {
            searchResults.innerHTML = `
                <p><strong>${resultado[0]}:</strong> ${resultado[1]}</p>
                <button class='copy-btn' onclick='copiarTexto("${resultado[0]}: ${resultado[1]}")'>📋</button>
                <button class='map-btn' onclick='abrirMapa("${resultado[1]}")'>🗺️</button>
            `;
        } else {
            searchResults.innerHTML = "Nenhum resultado encontrado.";
        }
    }

    function copiarTexto(texto) {
        navigator.clipboard.writeText(texto).then(() => {
            mostrarFeedback();
        }).catch(err => console.error('Erro ao copiar:', err));
    }

    function abrirMapa(link) {
        const url = link.split(' - ')[1];  // Extrai o link do Google Maps
        window.open(url, '_blank');
    }

    function mostrarFeedback() {
        const feedback = document.getElementById('copyFeedback');
        feedback.classList.add('show');
        setTimeout(() => {
            feedback.classList.remove('show');
        }, 2000);
    }

    const searchBar = document.getElementById("searchBar");
    const suggestions = document.getElementById("suggestions");
    const searchResults = document.getElementById("searchResults");

    searchBar.addEventListener("input", function (event) {
        const termo = event.target.value;
        const sugestoes = buscarSugestoes(termo);
        suggestions.innerHTML = sugestoes.map(([chave]) => `<p>${chave}</p>`).join('');
        suggestions.style.display = sugestoes.length ? 'block' : 'none';
    });

    function selectSuggestion(termo) {
        searchBar.value = termo;
        search(termo);
        suggestions.style.display = 'none';
    }

    searchBar.addEventListener("keypress", function (event) {
        if (event.key === "Enter") {
            const termo = searchBar.value;
            selectSuggestion(termo);
        }
    });

    suggestions.addEventListener("click", function (event) {
        if (event.target.tagName === "P") {
            selectSuggestion(event.target.textContent);
        }
    });
</script>
